import string

class Solution:
    def countPalindromicSubsequence(self, s: str) -> int:
        def is_a_subsequence(t):
            offset = 0
            for ch in t:
                i = s.find(ch, offset)
                if i == -1:
                    return False
                offset = i + 1
            return True
        # Since a subsequence is to be counted only once, there are only 26*26 = 676 subsequences at the most
        # We can check for each in the string. I think a regex might also work here, but it could be slow.
        all_palindromes = [x + y + x for x in string.ascii_lowercase for y in string.ascii_lowercase]
        res = 0
        for p in all_palindromes:
            res += int(is_a_subsequence(p))
        return res

